webpackJsonp([0xba3e4fc1124c],{4164:function(t,a){t.exports={data:{markdownRemark:{html:"<p>thGは夢終劇みたいに、グラフィックデータとか効果音データとかその辺のデータが野ざらしのまんまじゃちょっと色々と事情があってまずいので、そいつらを1つに固めて突っ込むパッケージ作らにゃー、って思って最初弾幕風のデータフォーマット参考にしてたんだがある時th07.dat覗いてみたら解析の手がかりになりそうな文字列が全く転がってないのな。これを展開するツールこさえた香具師は一体どうやって解析したんんだ？少なくとも本体の逆汗でもしないとウチには無理だなこりゃ。 とりあえず基本的なグラフィックエンジンと前述のパッケージ読み出し機能、あとはテスト用の簡易MAPが完成。BGMはまだすっからかんだからもし間に合わなかったらEURO-ROMANCE辺りでもBGMに流してもらえれば（ｒｙ やっぱり時期的には順調にいけば、4月前後くらいにもうちょっと詳細公開(もしかしたら内輪レベルでテスト版配布できるかも)、6月頭くらいには一般向けテスト版が配布できるかも。……かも orz</p>\n<h2>(拍)夢終劇の本編ってEDはいくつ存在するんですか？</h2>\n<p>正しくはBAD・NORMAL・GOODの3つです。(あれとあれも含めてしまうとまぁ5つとも言えなくもないですが)ちなみに時封城も3つです。(BADx1・GOODx2)</p>\n<h2>(拍)ZIP</h2>\n<p>Zipよこせコメが増えたら考えなくもない。</p>\n<h2>(拍)あの作品内で最終的にメリーはどうなりました？彼女に関して気になる説がありまして</h2>\n<p>ｋｗｓｋ こんな作品からどんな解釈が出てくるのか、賛否一切抜きにしてすごい興味あるんですが。ちなみに……夢終劇ではメリーさんは出てきませんよ？もし時封城の間違いだとしたら、びしばしメリーでぐぐってもらえればおおよそ理解できたつもりになれるかも（← もうひとつちなみに。夢終劇は必ずしも時封城より後のストーリーとは限らないです。</p>",frontmatter:{cover:null,date:"2008-02-21T02:38:00+09:00",strDate:"2008/2/20",title:"th07.datみたいなのを作ってて"}}},pathContext:{path:"/ja/blog/2008/02/21-th07-datみたいなのを作ってて/",langKey:"ja"}}}});
